import { Link } from "react-router-dom";
import bannerImage from "../../images/banner1.jpg";
import styles from "./Banner.module.css";

const Banner = () => {
  return (
    <>
      <div
        className={styles["banner-image"]}
        style={{
          backgroundImage: `linear-gradient(to bottom, rgba(163, 158, 158, 0.4), rgba(0, 0, 0.6, 0.73)),
          url(${bannerImage})`,
          backgroundSize: "cover",
        }}
      >
        <div className="container py-4">
          <div>
            <h3>New Inspiration 2020</h3>
            <p>20% off on new season</p>
            <Link to="/shop">Browse collections</Link>
          </div>
        </div>
      </div>
    </>
  );
};

export default Banner;
